import sunny from './sunny.png'
import './App.css';

function App() {
  return (
    <div className="App">

      <div className='deg-temp'>
            <img src={sunny} alt="" />
            <div className='top-degree'>62C</div>
      </div>
      <div className='fare-celc'>
          <div className='farenheigh'>F</div>
          <div>|</div>
          <div className="celcius">C</div>
      </div>
      <div className='precip-hum'>
        <div className='topdetail' id="precipitation">Precipitation: 0%</div>
        <div className='topdetail' id="humidity">Humidity: 59%</div>
        <div className='topdetail' id="wind">Wind: 7mph</div>
      </div>

    </div>
  );
}

export default App;
